import React from 'react';
import Link from 'react-router-dom/Link';

export default function Nav() {
  return (
    <nav className="nav">
      <Link 
        to={{
          pathname: '/',
          state: { prev: false },
        }} 
        className="nav__link"
      >
        Home
      </Link>
      <Link 
        to={{
          pathname: '/video',
          state: { prev: false },
        }}
        className="nav__link"
      >
        Video
      </Link>
      <Link 
        to={{
          pathname: '/account',
          state: { prev: true },
        }}
        className="nav__link"
      >
        Account
      </Link>
    </nav>
  );
}
